Вас ждут специальные предложения, новости и акции, доставка на дом, бронирование столов и организация банкетов. 

Покажите официанту QR-код из приложения при оплате счета, чтобы получить бонусные баллы WRF — вы сможете расплатиться ими уже при следующем посещении!

